import { useState } from 'react';
import GuestCard from './GuestCard';

const GuestGrid = ({ guests, deleteGuest }) => {



    return (
        <div className="guest-wrapper">
            {guests.map(guest => {
                return (
                    <GuestCard
                        key={guest._id}
                        guest={guest}
                        deleteGuest={deleteGuest}
                    />
                )
            })}
        </div>
    )
}




export default GuestGrid
